                case 3:
                    comboBox1.Text = "حقن";
                    break;
                case 2:
                    comboBox1.Text = "اقراص";
                    break;
                case 4:
                    comboBox1.Text = "كريم/مرهم";
                    break;
                case 0:
                    comboBox1.Text = "اخرى";
                    break;
                default:
                    comboBox1.Text = "غير معروف";
                    break;
            }
        }

        private System.Windows.Forms.ToolStripMenuItem ماالجديدToolStripMenuItem;
